import { BrowserRouter } from "react-router-dom";
import App_Router from "./components/App_Router/App_Router";
import Footer from "./components/Footer/Footer";

function App() {
  return (
    <div className="wrapper">
      <div className="container">
        <BrowserRouter>
          <App_Router />
        </BrowserRouter>
      </div>
        <Footer />
    </div>
  );
}

export default App;
